                <g opacity="100%">
                  <text x="136" y="102" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="164">Discover the Coffee Culture Blogging Community</tspan>
                  </text>
                </g>
                <g opacity="100%" filter="url(#filter_dshadow_0_0_0_00000014)">
                  <rect x="130" y="192" width="510" height="510" rx="2" fill="url(#image-pattern-ad74b929-c705-4ec9-aaf0-c81d2ca16215)"></rect>

                <g opacity="100%">
                  <text x="159" y="788.5" font-family="Roboto" font-size="48" fill="#030303" letter-spacing="0" font-weight="600" font-style="normal">
                    <tspan x="254">Our Mission</tspan>
                  </text>
                </g>
                <g opacity="100%">
                  <rect x="0" y="1003" width="770" height="2" fill="#f0f0f0" rx="1"></rect>
                </g>
                <g opacity="100%">
                  <text x="4" y="843" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="7">CoffeeCulture is a vibrant and inclusive online community dedicated to celebrating the</tspan>
                  </text>
                  <text x="4" y="869" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="21">diverse world of coffee. Our mission is to foster a space where coffee enthusiasts,</tspan>
                  </text>
                  <text x="4" y="895" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="30">from the casual sipper to the seasoned barista, can come together to share their</tspan>
                  </text>
                  <text x="4" y="921" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="19">passion, knowledge, and experiences. We strive to create an engaging, informative,</tspan>
                  </text>
                  <text x="4" y="947" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="48">and friendly environment where members can explore the rich history, varied</tspan>
                  </text>
                  <text x="4" y="973" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="11">techniques, and cultural significance of coffee. By offering a platform for discussion,</tspan>
                  </text>
                  <text x="4" y="999" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="14">education, and collaboration, CoffeeCulture aims to enrich the coffee experience for</tspan>
                  </text>
                  <text x="4" y="1025" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="39">everyone, whether they are discovering a new local cafe, perfecting their home</tspan>
                  </text>
                  <text x="4" y="1051" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="110">brewing skills, or exploring the global impact of coffee culture.</tspan>
                  </text>
                  <text x="4" y="1077" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="15">At the heart of CoffeeCulture is a commitment to sustainability and ethical practices</tspan>
                  </text>
                  <text x="4" y="1103" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="25">within the coffee industry. We believe in supporting fair trade and environmentally</tspan>
                  </text>
                  <text x="4" y="1129" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="38">friendly methods, ensuring that our love for coffee contributes positively to the</tspan>
                  </text>
                  <text x="4" y="1155" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="19">communities that grow and produce it. Our website features a wealth of resources,</tspan>
                  </text>
                  <text x="4" y="1181" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="9">including expert articles, user-generated content, and interactive forums, all designed</tspan>
                  </text>
                  <text x="4" y="1207" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="7">to nurture a deeper understanding and appreciation of coffee. Through CoffeeCulture,</tspan>
                  </text>
                  <text x="4" y="1233" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="23">we aspire to connect people from all walks of life, fostering a sense of community</tspan>
                  </text>
                  <text x="4" y="1259" font-family="Roboto" font-size="20" fill="#030303" letter-spacing="0" font-weight="normal" font-style="normal">
                    <tspan x="221">and shared joy in the world of coffee.</tspan>
                  </text>
                </g>
